- input: "TEXT\x1CC00522326\x1C.TEXT\x1C\x1CF3XA\x1CContributions to the Committee
    from conduit, ActBlue, totalled $9,625.00 during this reporting period. All receipts
    over $200.00 were reported as an itemized item under Section 11(a)(i), which totalled
    $650.00. The other receipts were reported as unitemized items under Section 11(a)(ii),
    which totalled $8,975.00.                                                                                                                                                                     June
    27, 2013                                                                                                                                                                                                                                                     Pursuant
    to a Request for Additional Informaiton dated May 23, 2013 by Maureen Benitz,
    Senior Campaign Finance & Review Analyst, Federal Election Commission, this said
    report is hereby amended to reflect that $18,067.00 was reported originally on
    Schedule A, line 11(a)(i) as itemized contribuitons when in fact they should have
    been reported on Schedule A, line 11(a)(ii).  This amended reported represents
    the correct information as the individuals which contributed to this Committee
    and had not aggregated greater than $200 in the calendar year to the date of said
    report were reported correctly as unitemized contributions. Gregory E. Sanborn,
    Treasurer\n"
